import React from 'react'

import { Route, Switch, HashRouter } from 'react-router-dom'

import Login from '../views/login'
import CadastroUsuario from '../views/cadastroUsuario'
import Home from '../views/home'
import ConsultaLancamentos from '../views/lacamentos/consulta-lancamentos'
import cadastroLancamentos from '../views/lacamentos/cadastro-lancamentos'

function RotaAutenticada(props){
    return(
        <Route {...props} />
    );
}

function Rotas(){

    return(

        <HashRouter >
            <Switch >
                <Route path="/home" component={Home} />
                <Route path="/login" component={Login} />
                <Route path="/cadastro-usuarios" component={CadastroUsuario} />
                <Route path="/consulta-lancamentos" component={ConsultaLancamentos} />
                <Route path="/cadastro-lancamentos/:id?" component={cadastroLancamentos} />
            </Switch>
        </HashRouter>

    )

}

export default Rotas;
